import logo3 from '../assets/imgs/Group 152.png';
import logo4 from '../assets/imgs/Group 153.png';
import logo5 from '../assets/imgs/Group 154.png';
import logo6 from '../assets/imgs/Group 155.png';
import logo7 from '../assets/imgs/Group 156.png';
import Button from 'react-bootstrap/Button';
import Side1 from '../assets/imgs/Rectangle 51.png';
import '../assets/css/Section2.css'

function HeroSection() {

    return (
        <>
            <div className='contain-1'>
                <Container fluid="md" >



                    <Row className='rrow-2'>
                        <Row className='row-1'>
                            <Col><h1>The Future of Web3 NoCode</h1></Col>


                        </Row>

                        <Row className='row-2'>
                            Web3Makr allows you to incorporate top ranked blockchain platforms into your work through the drag and drop feature.

                        </Row>



                        <Col sm={4}>

                        </Col>
                        <Col sm={8}>

                        </Col>
                    </Row>







                </Container>

            </div>

        </>
    );
}

export default HeroSection;
